import './App.css';
import BotList from './components/botlist';
import 'bootstrap/dist/css/bootstrap.min.css';
import TradeHistory from './components/TradeHistroy';
import {Route, Switch} from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Switch></Switch>
      <TradeHistory/>
      <BotList/>
    </div>
  );
}

export default App;
